import { GridRow } from "emotion-flex-grid";
import React from "react";
import "./MenuMobile.css";

export default function Menu() {
  return (
    <div>
      <GridRow direction="column" className="menu-container">
        <a href="#">Deposit</a>
        <a href="#">Dashboard</a>
        <a href="#">Company</a>
        <a href="#">Pricing</a>
      </GridRow>
    </div>
  );
}
